        // Function to create diagram element
        function createDiagramElement() {
            // Create an SVG with embedded draw.io data
            const svg = `<?xml version="1.0" encoding="UTF-8"?>
<!DOCTYPE svg PUBLIC "-//W3C//DTD SVG 1.1//EN" "http://www.w3.org/Graphics/SVG/1.1/DTD/svg11.dtd">
<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" version="1.1" width="100%" height="100%" viewBox="0 0 1654 1169" content="${btoa(diagramXML)}" style="background-color: rgb(255, 255, 255);">
<defs/>
<g>
<rect x="0" y="0" width="1654" height="1169" fill="#ffffff" stroke="none" pointer-events="all"/>
<text x="827" y="585" fill="#666666" font-family="Helvetica" font-size="20px" text-anchor="middle">Loading 2025-04_26_Fleet-out_Spain_Lifecycle_Diagram...</text>
</g>
</svg>`;
            
            // Create image element
            const img = document.createElement('img');
            img.style.width = '100%';
            img.style.height = '100%';
            img.style.cursor = 'pointer';
            img.style.objectFit = 'contain';
            img.src = 'data:image/svg+xml;base64,' + btoa(svg);
            
            // Add click handler for editing
            img.onclick = function() {
                // Configuration to hide Format and Shapes panels
                const config = {
                    defaultLibraries: 'general',  // Only show general shapes
                    libraries: false,  // Don't show the shapes panel
                    ui: 'simple'  // Use simple UI
                };
                
                // URL params to control the UI
                const urlParams = [
                    'format=0',  // Hide format panel
                    'layers=1',  // Show layers
                    'lightbox=1',  // Lightbox mode
                    'nav=1',  // Show navigation
                    'pages=0',  // Hide pages
                    'tooltips=1'  // Show tooltips
                ];
                
                DiagramEditor.editElement(this, config, 'simple', null, urlParams);
            };
            
            return img;
        }
        
        // Initialize on page load
        window.onload = function() {
            const container = document.getElementById('diagram-container');
            const diagramImg = createDiagramElement();
            container.appendChild(diagramImg);
            
            // Auto-open editor to render the diagram
            setTimeout(() => {
                diagramImg.click();
                // Hide the hint after first click
                document.querySelector('.edit-hint').style.display = 'none';
            }, 500);
        };
    </script>
